INFO  [alembic.runtime.migration] Running upgrade  -> 001, Initial schema: symbol_resolution, scan_cache, ohlcv, 
sessions, messages.
-- Running upgrade  -> 001

CREATE TABLE symbol_resolution (
    isin VARCHAR(20) NOT NULL, 
    symbol VARCHAR(20) NOT NULL, 
    name VARCHAR(255), 
    source VARCHAR(50), 
    updated_at TIMESTAMP WITH TIME ZONE, 
    PRIMARY KEY (isin)
);

CREATE TABLE scan_cache (
    symbol VARCHAR(20) NOT NULL, 
    data_type VARCHAR(50) NOT NULL, 
    interval VARCHAR(20) DEFAULT '' NOT NULL, 
    payload JSONB NOT NULL, 
    fetched_at TIMESTAMP WITH TIME ZONE NOT NULL, 
    PRIMARY KEY (symbol, data_type, interval)
);

CREATE INDEX ix_scan_cache_symbol_data_type ON scan_cache (symbol, data_type);

CREATE TABLE ohlcv (
    time TIMESTAMP WITH TIME ZONE NOT NULL, 
    symbol VARCHAR(20) NOT NULL, 
    open NUMERIC(20, 4), 
    high NUMERIC(20, 4), 
    low NUMERIC(20, 4), 
    close NUMERIC(20, 4), 
    volume BIGINT, 
    PRIMARY KEY (time, symbol)
);

CREATE TABLE sessions (
    id BIGSERIAL NOT NULL, 
    isin VARCHAR(20) NOT NULL, 
    title VARCHAR(255), 
    created_at TIMESTAMP WITH TIME ZONE, 
    scan_context JSONB, 
    sub_agent_summaries JSONB, 
    PRIMARY KEY (id)
);

CREATE TABLE messages (
    id BIGSERIAL NOT NULL, 
    session_id BIGINT NOT NULL, 
    role VARCHAR(20) NOT NULL, 
    content TEXT NOT NULL, 
    created_at TIMESTAMP WITH TIME ZONE, 
    PRIMARY KEY (id), 
    FOREIGN KEY(session_id) REFERENCES sessions (id)
);


INFO  [alembic.runtime.migration] Running upgrade 001 -> 002, Add stocks table and seed from CSV.
-- Running upgrade 001 -> 002

CREATE TABLE stocks (
    isin VARCHAR(20) NOT NULL, 
    name VARCHAR(255) NOT NULL, 
